#Punctuation is just fillers, likely a sentance with punct filler between letters.
#Need to remove the punctuation as not to mix up the letters
import string

def remove_punct(text):
	no_punct = ""
	for char in text:
		if not (char in string.punctuation):
			no_punct = no_punct + char


	return no_punct

